mous in Source Title]Ut magna diam, condimentum nec vulputate eget, blandit condimentum ligula. Nunc sagittis molestie nulla, et fringilla est adipiscing at. Proin aliquet sapien ut justo viverra at interdum risus posuere. Integer hendrerit nisi dignissim nibh mattis accumsan. .[/quote]\r\n<br/>\r\n[quote align=left source=Someone famous in Source Title]Ut magna diam, condimentum nec vulputate eget, blandit condimentum ligula. Nunc sagittis molestie nulla, et fringilla est adipiscing at. Proin aliquet sapien ut justo viverra at interdum risus posuere. Integer hendrerit nisi dignissim nibh mattis accumsan. .[/quote]\r\n\r\n[space height=20][/space]\r\n\r\n<h3>Get The Code</h3>\r\n\r\n\r\n[highlighter brush=jscript] [quote align={align} source={source}]{content} [ /quote] [/highlighter]\r\n\r\n','',1,0,0,78,'2013-08-29 08:02:26',374,'','2014-02-07 02:50:29',374,0,'0000-00-00 00:00:00','2013-08-29 08:02:26','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,14,'','',1,27,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(73,178,'Buttons','buttons','','<h2 id=\"buttons-options\">Options</h2>\r\n    <p>Use any of the available button classes to quickly create a styled button.</p>\r\n    <div class=\"bs-example\">\r\n      <button type=\"button\" class=\"btn btn-default\">Default</button>\r\n      <button type=\"button\" class=\"btn btn-primary\">Primary</button>\r\n      <button type=\"button\" class=\"btn btn-success\">Success</button>\r\n      <button type=\"button\" class=\"btn btn-info\">Info</button>\r\n      <button type=\"button\" class=\"btn btn-warning\">Warning</button>\r\n      <button type=\"button\" class=\"btn btn-danger\">Danger</button>\r\n      <button type=\"button\" class=\"btn btn-link\">Link</button>\r\n    </div>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"c\">&lt;!-- Standard gray button with gradient --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span><span class=\"nt\">&gt;</span>Default<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Provides extra visual weight and identifies the primary action in a set of buttons --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary\"</span><span class=\"nt\">&gt;</span>Primary<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Indicates a successful or positive action --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-success\"</span><span class=\"nt\">&gt;</span>Success<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Contextual button for informational alert messages --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-info\"</span><span class=\"nt\">&gt;</span>Info<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Indicates caution should be taken with this action --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-warning\"</span><span class=\"nt\">&gt;</span>Warning<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Indicates a dangerous or potentially negative action --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-danger\"</span><span class=\"nt\">&gt;</span>Danger<span class=\"nt\">&lt;/button&gt;</span>\r\n\r\n<span class=\"c\">&lt;!-- Deemphasize a button by making it look like a link while maintaining button behavior --&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-link\"</span><span class=\"nt\">&gt;</span>Link<span class=\"nt\">&lt;/button&gt;</span>\r\n</code></pre></div>\r\n\r\n    <h2 id=\"buttons-sizes\">Sizes</h2>\r\n    <p>Fancy larger or smaller buttons? Add <code>.btn-lg</code>, <code>.btn-sm</code>, or <code>.btn-xs</code> for additional sizes.</p>\r\n    <div class=\"bs-example\">\r\n      <p>\r\n        <button type=\"button\" class=\"btn btn-primary btn-lg\">Large button</button>\r\n        <button type=\"button\" class=\"btn btn-default btn-lg\">Large button</button>\r\n      </p>\r\n      <p>\r\n        <button type=\"button\" class=\"btn btn-primary\">Default button</button>\r\n        <button type=\"button\" class=\"btn btn-default\">Default button</button>\r\n      </p>\r\n      <p>\r\n        <button type=\"button\" class=\"btn btn-primary btn-sm\">Small button</button>\r\n        <button type=\"button\" class=\"btn btn-default btn-sm\">Small button</button>\r\n      </p>\r\n      <p>\r\n        <button type=\"button\" class=\"btn btn-primary btn-xs\">Extra small button</button>\r\n        <button type=\"button\" class=\"btn btn-default btn-xs\">Extra small button</button>\r\n      </p>\r\n    </div>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"nt\">&lt;p&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary btn-lg\"</span><span class=\"nt\">&gt;</span>Large button<span class=\"nt\">&lt;/button&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-lg\"</span><span class=\"nt\">&gt;</span>Large button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;/p&gt;</span>\r\n<span class=\"nt\">&lt;p&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary\"</span><span class=\"nt\">&gt;</span>Default button<span class=\"nt\">&lt;/button&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span><span class=\"nt\">&gt;</span>Default button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;/p&gt;</span>\r\n<span class=\"nt\">&lt;p&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary btn-sm\"</span><span class=\"nt\">&gt;</span>Small button<span class=\"nt\">&lt;/button&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-sm\"</span><span class=\"nt\">&gt;</span>Small button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;/p&gt;</span>\r\n<span class=\"nt\">&lt;p&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary btn-xs\"</span><span class=\"nt\">&gt;</span>Extra small button<span class=\"nt\">&lt;/button&gt;</span>\r\n  <span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-xs\"</span><span class=\"nt\">&gt;</span>Extra small button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;/p&gt;</span>\r\n</code></pre></div>\r\n\r\n    <p>Create block level buttons—those that span the full width of a parent— by adding <code>.btn-block</code>.</p>\r\n    <div class=\"bs-example\">\r\n      <div class=\"well\" style=\"max-width: 400px; margin: 0 auto 10px;\">\r\n        <button type=\"button\" class=\"btn btn-primary btn-lg btn-block\">Block level button</button>\r\n        <button type=\"button\" class=\"btn btn-default btn-lg btn-block\">Block level button</button>\r\n      </div>\r\n    </div>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary btn-lg btn-block\"</span><span class=\"nt\">&gt;</span>Block level button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-lg btn-block\"</span><span class=\"nt\">&gt;</span>Block level button<span class=\"nt\">&lt;/button&gt;</span>\r\n</code></pre></div>\r\n\r\n\r\n    <h2 id=\"buttons-disabled\">Disabled state</h2>\r\n    <p>Make buttons look unclickable by fading them back 50%.</p>\r\n\r\n    <h3>Button element</h3>\r\n    <p>Add the <code>disabled</code> attribute to <code>&lt;button&gt;</code> buttons.</p>\r\n    <p class=\"bs-example\">\r\n      <button type=\"button\" class=\"btn btn-primary btn-lg\" disabled=\"disabled\">Primary button</button>\r\n      <button type=\"button\" class=\"btn btn-default btn-lg\" disabled=\"disabled\">Button</button>\r\n    </p>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-lg btn-primary\"</span> <span class=\"na\">disabled=</span><span class=\"s\">\"disabled\"</span><span class=\"nt\">&gt;</span>Primary button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-lg\"</span> <span class=\"na\">disabled=</span><span class=\"s\">\"disabled\"</span><span class=\"nt\">&gt;</span>Button<span class=\"nt\">&lt;/button&gt;</span>\r\n</code></pre></div>\r\n\r\n    <div class=\"bs-callout bs-callout-danger\">\r\n      <h4>Cross-browser compatibility</h4>\r\n      <p>If you add the <code>disabled</code> attribute to a <code>&lt;button&gt;</code>, Internet Explorer 9 and below will render text gray with a nasty text-shadow that we cannot fix.</p>\r\n    </div>\r\n\r\n    <h3>Anchor element</h3>\r\n    <p>Add the <code>.disabled</code> class to <code>&lt;a&gt;</code> buttons.</p>\r\n    <p class=\"bs-example\">\r\n      <a href=\"#\" class=\"btn btn-primary btn-lg disabled\">Primary link</a>\r\n      <a href=\"#\" class=\"btn btn-default btn-lg disabled\">Link</a>\r\n    </p>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"nt\">&lt;a</span> <span class=\"na\">href=</span><span class=\"s\">\"#\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-primary btn-lg disabled\"</span><span class=\"nt\">&gt;</span>Primary link<span class=\"nt\">&lt;/a&gt;</span>\r\n<span class=\"nt\">&lt;a</span> <span class=\"na\">href=</span><span class=\"s\">\"#\"</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default btn-lg disabled\"</span><span class=\"nt\">&gt;</span>Link<span class=\"nt\">&lt;/a&gt;</span>\r\n</code></pre></div>\r\n    <p>\r\n      We use <code>.disabled</code> as a utility class here, similar to the common <code>.active</code> class, so no prefix is required.\r\n    </p>\r\n    <div class=\"bs-callout bs-callout-warning\">\r\n      <h4>Link functionality not impacted</h4>\r\n      <p>This class will only change the <code>&lt;a&gt;</code>\'s appearance, not its functionality. Use custom JavaScript to disable links here.</p>\r\n    </div>\r\n\r\n\r\n    <h2 id=\"buttons-tags\">Button tags</h2>\r\n    <p>Use the button classes on an <code>&lt;a&gt;</code>, <code>&lt;button&gt;</code>, or <code>&lt;input&gt;</code> element.</p>\r\n    <form class=\"bs-example\">\r\n      <a class=\"btn btn-default\" href=\"#\">Link</a>\r\n      <button class=\"btn btn-default\" type=\"submit\">Button</button>\r\n      <input class=\"btn btn-default\" value=\"Input\" type=\"button\">\r\n      <input class=\"btn btn-default\" value=\"Submit\" type=\"submit\">\r\n    </form>\r\n<div class=\"highlight\"><pre><code class=\"html\"><span class=\"nt\">&lt;a</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span> <span class=\"na\">href=</span><span class=\"s\">\"#\"</span><span class=\"nt\">&gt;</span>Link<span class=\"nt\">&lt;/a&gt;</span>\r\n<span class=\"nt\">&lt;button</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span> <span class=\"na\">type=</span><span class=\"s\">\"submit\"</span><span class=\"nt\">&gt;</span>Button<span class=\"nt\">&lt;/button&gt;</span>\r\n<span class=\"nt\">&lt;input</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span> <span class=\"na\">type=</span><span class=\"s\">\"button\"</span> <span class=\"na\">value=</span><span class=\"s\">\"Input\"</span><span class=\"nt\">&gt;</span>\r\n<span class=\"nt\">&lt;input</span> <span class=\"na\">class=</span><span class=\"s\">\"btn btn-default\"</span> <span class=\"na\">type=</span><span class=\"s\">\"submit\"</span> <span class=\"na\">value=</span><span class=\"s\">\"Submit\"</span><span class=\"nt\">&gt;</span>\r\n</code></pre></div>\r\n\r\n    <div class=\"bs-callout bs-callout-warning\">\r\n      <h4>Cross-browser rendering</h4>\r\n      <p>As a best practice, <strong>we highly recommend using the <code>&lt;button&gt;</code> element whenever possible</strong> to ensure matching cross-browser rendering.</p>\r\n      <p>Among other things, there\'s <a href=\"https://bugzilla.mozilla.org/show_bug.cgi?id=697451\">a Firefox bug</a> that prevents us from setting the <code>line-height</code> of <code>&lt;input&gt;</code>-based buttons, causing them to not exactly match the height of other buttons on Firefox.</p>\r\n    </div>','',1,0,0,78,'2013-08-29 08:02:59',374,'','2014-02-07 02:50:54',374,0,'0000-00-00 00:00:00','2013-08-29 08:02:59','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\