 && $item->level > 1 && !in_array($item->parent_id, $path))\r\n						|| ($start > 1 && !in_array($item->tree[$start-2], $path))\r\n					) {\r\n						unset($items[$i]);\r\n						continue;\r\n					}\r\n\r\n					$item->deeper = false;\r\n					$item->shallower = false;\r\n					$item->level_diff = 0;\r\n\r\n					if (isset($items[$lastitem])) {\r\n						$items[$lastitem]->deeper		= ($item->level > $items[$lastitem]->level);\r\n						$items[$lastitem]->shallower	= ($item->level &lt; $items[$lastitem]->level);\r\n						$items[$lastitem]->level_diff	= ($items[$lastitem]->level - $item->level);\r\n					}\r\n\r\n					$item->parent = (boolean) $menu->getItems(\'parent_id\', (int) $item->id, true);\r\n\r\n					$lastitem			= $i;\r\n					$item->active		= false;\r\n					$item->flink = $item->link;\r\n\r\n					// Reverted back for CMS version 2.5.6\r\n					switch ($item->type)\r\n					{\r\n						case \'separator\':\r\n							// No further action needed.\r\n							continue;\r\n\r\n						case \'url\':\r\n							if ((strpos($item->link, \'index.php?\') === 0) && (strpos($item->link, \'Itemid=\') === false)) {\r\n								// If this is an internal Joomla link, ensure the Itemid is set.\r\n								$item->flink = $item->link.\'&amp;Itemid=\'.$item->id;\r\n							}\r\n							break;\r\n\r\n						case \'alias\':\r\n							// If this is an alias use the item id stored in the parameters to make the link.\r\n							$item->flink = \'index.php?Itemid=\'.$item->params->get(\'aliasoptions\');\r\n							break;\r\n\r\n						default:\r\n							$router = JSite::getRouter();\r\n							if ($router->getMode() == JROUTER_MODE_SEF) {\r\n								$item->flink = \'index.php?Itemid=\'.$item->id;\r\n							}\r\n							else {\r\n								$item->flink .= \'&amp;Itemid=\'.$item->id;\r\n							}\r\n							break;\r\n					}\r\n\r\n					if (strcasecmp(substr($item->flink, 0, 4), \'http\') && (strpos($item->flink, \'index.php?\') !== false)) {\r\n						$item->flink = JRoute::_($item->flink, true, $item->params->get(\'secure\'));\r\n					}\r\n					else {\r\n						$item->flink = JRoute::_($item->flink);\r\n					}\r\n\r\n					$item->title = htmlspecialchars($item->title);\r\n					$item->anchor_css = htmlspecialchars($item->params->get(\'menu-anchor_css\', \'\'));\r\n					$item->anchor_title = htmlspecialchars($item->params->get(\'menu-anchor_title\', \'\'));\r\n					$item->menu_image = $item->params->get(\'menu_image\', \'\') ? htmlspecialchars($item->params->get(\'menu_image\', \'\')) : \'\';\r\n				}\r\n\r\n				if (isset($items[$lastitem])) {\r\n					$items[$lastitem]->deeper		= (($start?$start:1) > $items[$lastitem]->level);\r\n					$items[$lastitem]->shallower	= (($start?$start:1) &lt; $items[$lastitem]->level);\r\n					$items[$lastitem]->level_diff	= ($items[$lastitem]->level - ($start?$start:1));\r\n				}\r\n			}\r\n\r\n			$cache->store($items, $key);\r\n		}\r\n		return $items;\r\n	}\r\n}[/highlighter]<h3>Get the code</h3>[highlighter lang=\"js\" linenums=\"true\" startnums=\"1\"][highlighter lang=\"php\" linenums=\"true\" startnums=\"1\"]YOUR_CODE_HERE[/&#104;ighlighter][/highlighter]','',-2,0,0,78,'2013-08-29 08:11:03',374,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2013-08-29 08:11:03','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"sho