urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,0,'','',1,144,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(92,205,'About Us','about-us','','<div style=\"text-align: center;\"><span style=\"color: #282828; font-weight: bold; text-align: center; font-size: 30px;\">About Us</span></div>\r\n<div style=\"text-align: center;\"> </div>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">Meri Karapetyan is an innovative social enterprise in the field of luxury and fine jewelry, focused on providing the best quality products and services, unique experience and personalized storytelling.</p>\r\n<p style=\"text-align: justify;\">The founder of the company is Meri Karapetyan, a talented and young entrepreneur. Having completed her master studies at Catholic University of Eichstaett Ingolstadt, Meri Karapetyan uses her knowledge and experience to direct the creative and strategic development of the company.</p>\r\n<p style=\"text-align: justify;\">The mission of the company is to be one of the most ethical companies in the world that sets the trends and offers exclusiveness at high quality.</p>\r\n<p style=\"text-align: justify;\">The vision is to become the first choice of exclusive luxury jewelry, and a good citizen in the society, aiming to bring positive changes in the poor communities around the world.</p>\r\n<p style=\"text-align: justify;\">Meri Karapetyan is an ethical start-up that values integrity and treats stakeholders with respect and honesty. Being loyal to its principles and committed to creating sustainable values for the stakeholders, the company appreciates every employee by giving them face and voice. Teamwork is the core competence on which the company has built its total quality management system that focuses on meeting and exceeding all expectations.</p>\r\n<p style=\"text-align: justify;\">The attractiveness of the company consists of its unique designs, offering limited production, certified high quality precious gemstones and ethical diamonds  with Kimberley Process certification. Using only precious metals, Meri Karapetyan pieces are timeless and unique, with architectural inspiring patterns that makes the person who wears them shine at any occasion.</p>\r\n<p style=\"text-align: justify;\">The creativeness of the company is ensured by experienced and talented designers from different parts of the world: Italy, France, Austria, Armenia and Great Britain.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><br /> </p>','',1,0,0,14,'2015-09-23 17:27:20',374,'','2016-01-26 22:37:00',374,0,'0000-00-00 00:00:00','2015-09-23 17:27:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"0\",\"link_titles\":\"0\",\"show_intro\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"0\",\"show_author\":\"0\",\"link_author\":\"1\",\"show_create_date\":\"0\",\"show_modify