xt-align: justify;\">\r\n<p><img src=\"images/banners/Freight-In-Tehran.jpg\" border=\"0\" alt=\"\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n</div>','',1,0,0,82,'2016-11-11 20:05:41',374,'','2016-11-13 19:48:06',374,0,'0000-00-00 00:00:00','2016-11-11 20:05:41','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,5,'','',1,21,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(119,237,'حمل و نقل','حمل-و-نقل','','<div style=\"text-align: center;\"><span style=\"font-family: b yekan; color: #000080; font-weight: bold; text-align: center; font-size: 30px;\">حمل و نقل</span></div>\r\n<div style=\"text-align: center;\"> </div>\r\n<div style=\"text-align: justify; font-family: b yekan; font-size: 17px;\">\r\n<p>حمل اثاثیه منزل از قدیم الایام در بین مردم شایع بوده است.در گذشته اگر می خواستیم حمل اثاثیه منزل را انجام دهیم برای انجام این کار از فامیل و دوستان کمک میگرفتیم که هر کسی مسئولیت کاری را در حمل اثاثیه انجام می داد.اما امروزه به دلیل زیاد شدن گرفتاری ها و مشکلات نمیتوانیم اقوام و دوستان خود را برای این کار به کمک خود بیاوریم همچنین به دلیل سنگین بودن بعضی از وسایل منزل شاید از عهده این کار بر نیاییم. بنا به این دلایل <span style=\"color: #ff0000;\">باربری</span> و <span style=\"color: #ff0000;\">اتوبار</span> همسایه برای حمل اثاثیه منزل شما به کمک شما می آید و تا مرحله آخر اسباب کشی در خدمت شما عزیزان می باشد.<br /> <span style=\"color: #ff0000;\">باربری</span> همسایه برای <span style=\"color: #ff0000;\">حمل اثاثیه منزل</span> از کارگرانی بسیار خوش اخلاق و ورزیده و خاور های موکت کاری شده جهت انجام حمل وسایل شما استفاده می کند . ما اینجاییم تا خدماتی بی نظیر برای شما ارائه دهیم.</p>\r\n<ol>\r\n<li>ارائه خدمات <span style=\"color: #ff6600;\">بسته بندی</span> با کادر مخصوص جهت اسباب کشی</li>\r\n<li>بیمه و بارنامه وسایل شما به صورت کاملا رایگان</li>\r\n<li>مشاوره به صورت رایگان</li>\r\n<li>حمل بار توسط کارگران حرفه ای و ورزیده</li>\r\n<li>ارائه خاور ، نیسان ، وانت</li>\r\n</ol>\r\n<p>ما آماده ایم بارهای شما و اثاثیه منزل شما را با اطمینان کامل به مقصد و خانه جدیدتان برسانیم.</p>\r\n<p>شما عزیزان می توانید با تکیه بر رزومه قابل اعتماد باربری همسایه آنچه را که از یک اتوبار و باربری می خواهید را برای شما به عمل می آوریم.</p>\r\n<p>حمل جهزیه عروس با تخفیف ویژه ! حمل و جابجایی بار ادارت ، ارگانها ، بانک ها ، کارخانه ها ، کارگاه ها و ….</p>\r\n<p>این اطمینان را به شما عزیزان می دهیم که برای حمل اثاثیه و جابجایی منزل خبری از شکستن وسایل در کار نیست.</p>\r\n<p>برای تماس با باربری همسایه جهت حمل اثاثیه و وسایل منزل خود با شماره زیر تماس حاصل فرمایید و با خیالی آسوده وسایل منزل خودتان را جابجا کنید.</p>\r\n</div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify; font-family: b yekan; font-size: 17px;\">\r\n<p><span style=\"color: #ff204d;\">اتوبار</span> | <span style=\"color: #800080;\">باربری</span> | <span style=\"color: #000080;\">حمل اثاثیه منزل</span> | <span style=\"color: #80000a;\">باربری تهران</span> | <span style=\"color: #ff9900;\">باربری شبانه روزی</span>