 اتوبار معتبر | باربری همسایه | باربری غرب | حمل و نقل | اتوبار همسایه</p>\r\n</div>\r\n<div style=\"text-align: justify;\">\r\n<p><img src=\"images/banners/Freight-In-Tehran.jpg\" border=\"0\" alt=\"\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n</div>','',1,0,0,82,'2016-11-11 20:10:29',374,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2016-11-11 20:10:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,1,'','',1,16,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(123,242,'خدمات ما','خدمات-ما','','<div style=\"text-align: center;\"><span style=\"font-family: b yekan; color: #000080; font-weight: bold; text-align: center; font-size: 30px;\">خدمات باربری همسایه</span></div>\r\n<div style=\"text-align: center;\"> </div>\r\n<div style=\"text-align: justify; font-family: b yekan; font-size: 17px;\"><span style=\"color: #ff0000;\">باربری همسایه</span> در ابتدا کار خود را با هدف ارئه خدمات باربری و اتوبار به شهروندان بخشی