0-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}',0,'*'),(152,'BT Login','','',1,'top-menu',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'mod_bt_login',1,0,'{\"align_option\":\"right\",\"display_type\":\"0\",\"mouse_event\":\"click\",\"login\":\"\",\"logout\":\"\",\"name\":\"0\",\"logout_button\":\"1\",\"enabled_registration\":\"1\",\"enabled_registration_tab\":\"1\",\"enabled_login_tab\":\"1\",\"tag_login_modal\":\"#D341A1\",\"tag_register_modal\":\"#D341A1\",\"bg_button_color\":\"#ffffff\",\"text_button_color\":\"#000000\",\"use_captcha\":\"1\",\"integrated_component\":\"\",\"link_option\":\"\",\"loadJquery\":\"auto\",\"moduleclass_sfx\":\"\",\"cache\":\"1\"}',0,'*'),(153,'اتوبار و باربری همسایه','','<div style=\"text-align: center;\"><span style=\"font-family: b yekan; color: #003366; font-weight: bold; text-align: center; font-size: 30px;\">اتوبار و باربری همسایه</span></div>\r\n<div style=\"text-align: center;\"> </div>\r\n<div style=\"text-align: justify; font-family: b yekan; font-size: 17px;\">\r\n<p>باربری همسایه با ارائه خدمات شبانه روزی و سابقه ی درخشان( حمل اثاثیه منزل، حمل و نقل، بسته بندی لوازم منزل و اتوبار و باربری و اثاث کشی ) آماده ارائه ی خدمات به همشهریان عزیز تهرانی میباشد.</p>\r\n<p>خدمتگزاران شما در شرکت بزرگ اتوبار و باربری همسایه با بهره گیری از سالها تجربه آماده اند تا آنچه را شما از یک جابجایی بی دغدغه انتظار دارید به شما هدیه دهند . شما هموطنان عزیز با تکیه بر رزومه ی قابل اطمینان گروه اجرایی فعال در باربری همسایه میتوانید به تجربه ی باورنکردنی اسباب کشی منظم و برنامه ریزی شده دست یابید تا بعنوان خاطره ای شیرین در آینده از آن یاد کنید.</p>\r\n<p>گروه اجرایی اتوبار وباربری همسایه با مسئولیت پذیری در قبال شما ، خود را موظف میداند که بهترینها را ارائه دهد. اتوبار همسایه ، خدمات تخصصی بسته بندی لوازم منزل ، ارائه ی پکیج های مخصوص بسته بندی ، حمل اثاثیه منزل بین شهری، حمل و نقل اسباب و اثاث به شهرستان و … تنها بخشی جزئی از خدمات شرکت بزرگ اتوبار همسایه است.</p>\r\n<p>متخصص در محل و حمل و نقل و بسته بندی لوازم منزل و ادارات و شرکتها به صورت شبانه روزی حتی در ایام تعطیل با بیمه شهری و شهرستان با کادری مجرب و تضمینی در خدمت شهروندان می باشد. دقت، سرعت، برآورد هزینه منصفانه و تعهد از افتخارات این مجموعه است.</p>\r\n</div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify; font-family: b yekan; font-size: 17px;\">\r\n<p><span style=\"color: #ff204d;\">اتوبار</span> | <span style=\"color: #800080;\">باربری</span> | <span style=\"color: #000080;\">حمل اثاثیه منزل</span> | <span style=\"color: #80000a;\">باربری تهران</span> | <span style=\"color: #ff9900;\">باربری شبانه روزی</span> | <span style=\"color: #0000ff;\">بسته بندی اثاثیه</span> | <span style=\"color: #333399;\">اسباب کشی</span> | <span style=\"color: #ff00ff;\">بسته بندی لوازم منزل</span> | <span style=\"color: #ff9900;\">اتوبار و باربری همسایه</span> | <span style=\"color: #339966;\">باربری غرب تهران</span> |<span style=\"color: #800080;\"> اتوبار معتبر</span> | <span style=\"color: #000080;\">باربری همسایه</span> | <span style=\"color: #003300;\">باربری غرب</span> | <span style=\"color: #993300;\">حمل و نقل</span> | <span style=\"color: #0000ff;\">اتوبار همسایه</span></p>\r\n</div>\r\n<div style=\"text-align: justify;\">\r\n<p><img src=\"images/banners/Freight-In-Tehran.jpg\" border=\"0\" alt=\"\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n</div>',1,'zt_breadcrumbs',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}',0,'*'),(154,'product7','','<div class=\"zt_header\" style=\"text-align: left;\"><img src=\"images/7 3.jpg\" border=\"0\" alt=\"\" /></div>\r\n<div><a href=\"index.php/de/compo